          </Section>
          <Section {...layout.items}>
            <Card
              style={{
                height: '100px',
                width: '100px',
                borderRadius: '50%',
                margin: '10px'
              }}
            >
              7
            </Card>
          </Section>
          <Section>
            <Card
              style={{
                height: '100px',
                width: '100px',
                borderRadius: '50%',
                margin: '10px'
              }}
            >
              8
            </Card>
          </Section>
        </Section>
      </>
    );
  }
}

export default NewGames;
